import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Perform a search to get to results page with view toggle
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'electronics');

    await page.waitForSelector('.search-btn', { timeout: 5000 });
    await page.click('.search-btn');

    // Wait for search results to load
    await page.waitForSelector('.sort-filter-controls', { timeout: 5000 });

    // Take screenshot after search
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_results.png'));

    // Switch to list view mode
    await page.waitForSelector('button[title="List View"]', { timeout: 5000 });
    await page.click('button[title="List View"]');

    // Wait for view to switch
    await page.waitForSelector('.products-list', { timeout: 5000 });

    // Take screenshot after switching to list view
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_list_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_list_view.png'));

    // Extract data to verify the switch
    const viewMode = await page.$eval('button[title="List View"]', button => 
      button.classList.contains('active') ? 'list' : 'grid'
    );

    const productCount = await page.$$eval('.product-card-list', products => products.length);

    return {
      success: true,
      action: "Switched to list view mode successfully",
      extractedData: {
        currentViewMode: viewMode,
        productsInListView: productCount
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to switch to list view mode",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
